BEGIN TRANSACTION;
CREATE TABLE "schema_migrations" ("version" varchar(255) NOT NULL);
CREATE TABLE sqlite_sequence(name,seq);
CREATE TABLE "universities" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar(255), "fundation" varchar(255), "address" varchar(255), "city" varchar(255), "rector" varchar(255), "students" integer, "created_at" datetime, "updated_at" datetime, "alias" varchar(255));
CREATE TABLE "university_data" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "university_id" integer, "creditos_aprobados" varchar(255), "sueldos" varchar(255), "gastos" varchar(255), "adicional_dr" varchar(255), "adicional_ms" varchar(255), "ejecucion" varchar(255), "incentivo" varchar(255), "total" varchar(255), "date_from" datetime, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "university_searches" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "university_name" varchar(255), "created_at" datetime, "updated_at" datetime);
CREATE UNIQUE INDEX "unique_schema_migrations" ON "schema_migrations" ("version");
COMMIT;
